import MyFooter from "./components/myFooter";
import MyGallery from "./components/MyGallery";

function App() {
  return (
    <div className="App bg-dark text-white">
      <MyNavbar />
      <main id="card">
        <MyGallery nameMovies={"batman"}></MyGallery>
        <MyGallery nameMovies={"batman"}></MyGallery>
        <MyGallery nameMovies={"batman"}></MyGallery>
      </main>
